import Gestures from '../helpers/Gestures';
import TabBar from '../screenobjects/components/tab.bar';
import FormScreen from '../screenobjects/forms.screen';
import LoginScreen from '../screenobjects/login.screen';

describe('WebdriverIO and Appium, interacting with form elements,', () => {
    beforeEach(() => {
        TabBar.waitForTabBarShown(true);
        TabBar.openForms();
        FormScreen.waitForIsShown(true);
    });

    it('should be able type in the input and validate the text', () => {
        const text = 'Hello, this is a demo app';
        FormScreen.input.setValue(text);
        expect(FormScreen.inputTextResult.getText()).toEqual(text);

        /**
         * IMPORTANT!!
         *  Because the app is not closed and opened between the tests
         *  (and thus is NOT starting with the keyboard hidden)
         *  the keyboard is closed here if it is still visible.
         */
        if (driver.isKeyboardShown()) {
            driver.hideKeyboard();
        }
    });

    it('should be able turn on and off the switch', () => {
        expect(FormScreen.isSwitchActive()).toEqual(false);

        FormScreen.switch.click();
        expect(FormScreen.isSwitchActive()).toEqual(true);

        FormScreen.switch.click();
        expect(FormScreen.isSwitchActive()).toEqual(false);
    });

    it('should be able select a value from the select element', () => {
        const valueOne = 'This app is awesome';
        const valueTwo = 'webdriver.io is awesome';
        const valueThree = 'Appium is awesome';

        FormScreen.dropDown.click();
        FormScreen.picker.selectValue(valueOne);
        expect(FormScreen.getDropDownText()).toContain(valueOne);

        FormScreen.dropDown.click();
        FormScreen.picker.selectValue(valueTwo);
        expect(FormScreen.getDropDownText()).toContain(valueTwo);

        FormScreen.dropDown.click();
        FormScreen.picker.selectValue(valueThree);
        expect(FormScreen.getDropDownText()).toContain(valueThree);
    });

    it('should be able to open the alert and close it with all 3 buttons', () => {
        Gestures.checkIfDisplayedWithScrollDown(FormScreen.activeButton, 2);
        FormScreen.activeButton.click();
        FormScreen.alert.waitForIsShown(true);
        expect(LoginScreen.alert.text()).toEqual('This button is\nThis button is active');

        FormScreen.alert.pressButton('Ask me later');
        FormScreen.alert.waitForIsShown(false);
        FormScreen.activeButton.click();
        FormScreen.alert.waitForIsShown(true);
        FormScreen.alert.pressButton('Cancel');
        FormScreen.alert.waitForIsShown(false);
        FormScreen.activeButton.click();
        FormScreen.alert.waitForIsShown(true);
        FormScreen.alert.pressButton('OK');
        FormScreen.alert.waitForIsShown(false);
    });

    it('should be able to determine that the inactive button is inactive', () => {
        Gestures.checkIfDisplayedWithScrollDown(FormScreen.inActiveButton, 2);
        // In this case the button can't be asked if it is active or not with
        // `expect(FormScreen.inActiveButton.isEnabled()).toEqual(false);`
        // So use a click and check if shown, make sure the alert is not there
        FormScreen.alert.waitForIsShown(false);
        FormScreen.inActiveButton.click();
        // Just wait 1 second to be sure it didn't appear
        driver.pause(1000);
        // Now validate it isn't there
        FormScreen.alert.waitForIsShown(false);
    });
});

let SCREEN_SIZE;
/**
 * The values in the below object are percentages of the screen
 */
const SWIPE_DIRECTION = {
    down: {
        start: { x: 50, y: 15 },
        end: { x: 50, y: 85 },
    },
    left: {
        start: { x: 95, y: 50 },
        end: { x: 5, y: 50 },
    },
    right: {
        start: { x: 5, y: 50 },
        end: { x: 95, y: 50 },
    },
    up: {
        start: { x: 50, y: 85 },
        end: { x: 50, y: 15 },
    },
};

class Gestures {
    /**
     * Check if an element is visible and if not scroll down a portion of the screen to
     * check if it visible after a x amount of scrolls
     *
     * @param {element} element
     * @param {number} maxScrolls
     * @param {number} amount
     */
    static checkIfDisplayedWithScrollDown (element, maxScrolls, amount = 0) {
        if ((!element.isExisting() || !element.isDisplayed()) && amount <= maxScrolls) {
            this.swipeUp(0.85);
            this.checkIfDisplayedWithScrollDown(element, maxScrolls, amount + 1);
        } else if (amount > maxScrolls) {
            throw new Error(`The element '${element}' could not be found or is not visible.`);
        }
    }

    /**
     * Swipe down based on a percentage
     *
     * @param {number} percentage from 0 - 1
     */
    static swipeDown (percentage = 1) {
        this.swipeOnPercentage(
            this._calculateXY(SWIPE_DIRECTION.down.start, percentage),
            this._calculateXY(SWIPE_DIRECTION.down.end, percentage),
        );
    }

    /**
     * Swipe Up based on a percentage
     *
     * @param {number} percentage from 0 - 1
     */
    static swipeUp (percentage = 1) {
        this.swipeOnPercentage(
            this._calculateXY(SWIPE_DIRECTION.up.start, percentage),
            this._calculateXY(SWIPE_DIRECTION.up.end, percentage),
        );
    }

    /**
     * Swipe left based on a percentage
     *
     * @param {number} percentage from 0 - 1
     */
    static swipeLeft (percentage = 1) {
        this.swipeOnPercentage(
            this._calculateXY(SWIPE_DIRECTION.left.start, percentage),
            this._calculateXY(SWIPE_DIRECTION.left.end, percentage),
        );
    }

    /**
     * Swipe right based on a percentage
     *
     * @param {number} percentage from 0 - 1
     */
    static swipeRight (percentage = 1) {
        this.swipeOnPercentage(
            this._calculateXY(SWIPE_DIRECTION.right.start, percentage),
            this._calculateXY(SWIPE_DIRECTION.right.end, percentage),
        );
    }

    /**
     * Swipe from coordinates (from) to the new coordinates (to). The given coordinates are
     * percentages of the screen.
     *
     * @param {object} from { x: 50, y: 50 }
     * @param {object} to { x: 25, y: 25 }
     *
     * @example
     * <pre>
     *   // This is a swipe to the left
     *   const from = { x: 50, y:50 }
     *   const to = { x: 25, y:50 }
     * </pre>
     */
    static swipeOnPercentage (from, to) {
        SCREEN_SIZE = SCREEN_SIZE || driver.getWindowRect();
        const pressOptions = this._getDeviceScreenCoordinates(SCREEN_SIZE, from);
        const moveToScreenCoordinates = this._getDeviceScreenCoordinates(SCREEN_SIZE, to);
        this.swipe(
            pressOptions,
            moveToScreenCoordinates,
        );
    }

    /**
     * Swipe from coordinates (from) to the new coordinates (to). The given coordinates are in pixels.
     *
     * @param {object} from { x: 50, y: 50 }
     * @param {object} to { x: 25, y: 25 }
     *
     * @example
     * <pre>
     *   // This is a swipe to the left
     *   const from = { x: 50, y:50 }
     *   const to = { x: 25, y:50 }
     * </pre>
     */
    static swipe (from, to) {
        driver.touchPerform([{
            action: 'press',
            options: from,
        }, {
            action: 'wait',
            options: { ms: 1000 },
        }, {
            action: 'moveTo',
            options: to,
        }, {
            action: 'release',
        }]);
        driver.pause(1000);
    }

    /**
     * Get the screen coordinates based on a device his screensize
     *
     * @param {number} screenSize the size of the screen
     * @param {object} coordinates like { x: 50, y: 50 }
     *
     * @return {{x: number, y: number}}
     *
     * @private
     */
    static _getDeviceScreenCoordinates (screenSize, coordinates) {
        return {
            x: Math.round(screenSize.width * (coordinates.x / 100)),
            y: Math.round(screenSize.height * (coordinates.y / 100)),
        };
    }

    /**
     * Calculate the x y coordinates based on a percentage
     *
     * @param {object} coordinates
     * @param {number} percentage
     *
     * @return {{x: number, y: number}}
     *
     * @private
     */
    static _calculateXY ({ x, y }, percentage) {
        return {
            x: x * percentage,
            y: y * percentage,
        };
    }
}

export default Gestures;

export default class TabBar {
    static openHome () {
        $('~Home').click();
    }

    static openWebView () {
        $('~WebView').click();
    }

    static openLogin () {
        $('~Login').click();
    }

    static openForms () {
        $('~Forms').click();
    }

    static openSwipe () {
        $('~Swipe').click();
    }

    static waitForTabBarShown () {
        $('~Home').waitForDisplayed(20000);
    }
}

import NativeAlert from '../helpers/NativeAlert';
import Picker from '../helpers/Picker';
import { getTextOfElement } from '../helpers/utils';
import AppScreen from './app.screen';

const SELECTORS = {
    FORMS_SCREEN: '~Forms-screen',
    INPUT: '~text-input',
    INPUT_TEXT: '~input-text-result',
    SWITCH: '~switch',
    SWITCH_TEXT: '~switch-text',
    DROP_DOWN: '~select-Dropdown',
    ACTIVE_BUTTON: '~button-Active',
    IN_ACTIVE_BUTTON: '~button-Inactive',
};

class FormsScreen extends AppScreen {
    constructor () {
        super(SELECTORS.FORMS_SCREEN);
    }

    get input () {
        return $(SELECTORS.INPUT);
    }

    get inputTextResult () {
        return $(SELECTORS.INPUT_TEXT);
    }

    get switch () {
        return $(SELECTORS.SWITCH);
    }

    get switchText () {
        return $(SELECTORS.SWITCH_TEXT);
    }

    /**
     * Return if the switch is active or not active for iOS / Android
     * For Android the switch is `ON|OFF`, for iOS '1|0'
     *
     * @return {boolean}
     */
    isSwitchActive () {
        const active = driver.isAndroid ? 'ON' : '1';

        return this.switch.getText() === active;
    }

    get dropDown () {
        return $(SELECTORS.DROP_DOWN);
    }

    /**
     * Get the text of the drop down component
     *
     * @return {string}
     */
    getDropDownText () {
        return getTextOfElement($(SELECTORS.DROP_DOWN));
    }

    get picker () {
        return Picker;
    }

    get activeButton () {
        return $(SELECTORS.ACTIVE_BUTTON);
    }

    get inActiveButton () {
        return $(SELECTORS.IN_ACTIVE_BUTTON);
    }

    get alert () {
        return NativeAlert;
    }
}

export default new FormsScreen();

const SELECTORS = {
    ANDROID: {
        ALERT_TITLE: '*//android.widget.TextView[@resource-id="android:id/alertTitle"]',
        ALERT_MESSAGE: '*//android.widget.TextView[@resource-id="android:id/message"]',
        ALERT_BUTTON: '*//android.widget.Button[@text="{BUTTON_TEXT}"]',
    },
    IOS: {
        ALERT: '-ios predicate string:type == \'XCUIElementTypeAlert\'',
    },
};

class NativeAlert {
    /**
     * Wait for the alert to exist
     */
    static waitForIsShown (isShown = true) {
        const selector = driver.isAndroid ? SELECTORS.ANDROID.ALERT_TITLE : SELECTORS.IOS.ALERT;
        $(selector).waitForExist(11000, !isShown);
    }

    /**
     * Press a button in a cross-platform way.
     *
     * IOS:
     *  iOS always has an accessibilityID so use the `~` in combination
     *  with the name of the button as shown on the screen
     * ANDROID:
     *  Use the text of the button, provide a string and it will automatically transform it to uppercase
     *  and click on the button
     *
     * @param {string} selector
     */
    static pressButton (selector) {
        const buttonSelector = driver.isAndroid
            ? SELECTORS.ANDROID.ALERT_BUTTON.replace(/{BUTTON_TEXT}/, selector.toUpperCase())
            : `~${selector}`;
        $(buttonSelector).click();
    }

    /**
     * Get the alert text
     *
     * @return {string}
     */
    static text () {
        // return driver.getAlertText();
        if (driver.isIOS) {
            return driver.getAlertText();
        }

        return `${$(SELECTORS.ANDROID.ALERT_TITLE).getText()}\n${$(SELECTORS.ANDROID.ALERT_MESSAGE).getText()}`;
    }
}

export default NativeAlert;

const SELECTORS = {
    ANDROID_LISTVIEW: '//android.widget.ListView',
    IOS_PICKERWHEEL: '-ios predicate string:type == \'XCUIElementTypePickerWheel\'',
    DONE: `~header-Dropdown`,
};

class Picker {
    /**
     * Wait for the picker to be shown
     *
     * @param {boolean} isShown
     */
    static waitForIsShown (isShown = true) {
        const selector = driver.isIOS ? SELECTORS.IOS_PICKERWHEEL : SELECTORS.ANDROID_LISTVIEW;
        $(selector).waitForExist(11000, !isShown);
    }

    /**
     * Select a value from the picker
     *
     * @param {string} value The value that needs to be selected
     */
    static selectValue (value) {
        this.waitForIsShown(true);
        if (driver.isIOS) {
            this._setIosValue(value);
        } else {
            this._setAndroidValue(value);
        }
        this.waitForIsShown(false);
    }

    /**
     * Set the value for Android
     *
     * @param {string} value
     *
     * @private
     */
    static _setAndroidValue (value) {
        $(`${SELECTORS.ANDROID_LISTVIEW}/*[@text='${value}']`).click();
    }

    /**
     * Set the value for IOS
     *
     * @param {string} value
     *
     * @private
     */
    static _setIosValue (value) {
        $(SELECTORS.IOS_PICKERWHEEL).addValue(value);
        $(SELECTORS.DONE).click();
    }
}

export default Picker;

const SELECTORS = {
    ANDROID: {
        TEXT: '*//android.widget.TextView',
        TEXT_FIELD: '*//android.widget.EditText',
    },
    IOS: {
        GENERIC_TEXT: null,
        TEXT_ELEMENT: '-ios predicate string:type == \'XCUIElementTypeStaticText\'',
    },
};

/**
 * Get the text of an element (including all child elements)
 *
 * @param {element} element
 * @param {boolean} isXpath
 *
 * @return {string}
 */
export function getTextOfElement (element, isXpath = false) {
    let visualText;

    try {
        if (driver.isAndroid) {
            visualText = element.$$(SELECTORS.ANDROID.TEXT).reduce((currentValue, el) => `${currentValue} ${el.getText()}`, '');
        } else {
            const iosElement = isXpath ? element.$$(SELECTORS.IOS.TEXT_ELEMENT) : element;

            if (isXpath) {
                visualText = element.$$(SELECTORS.IOS.TEXT_ELEMENT).reduce((currentValue, el) => `${currentValue} ${el.getText()}`, '');
            } else {
                visualText = iosElement.getText();
            }
        }
    } catch (e) {
        visualText = element.getText();
    }

    return visualText.trim();
}

/**
 * Get the time difference in seconds
 *
 * @param {number} start    the time in milliseconds
 * @param {number} end      the time in milliseconds
 */
export function timeDifference (start, end) {
    const elapsed = (end - start) / 1000;
    console.log('elapsed = ', elapsed, ' seconds');
}

import { DEFAULT_TIMEOUT } from '../constants';

export default class AppScreen {
    constructor (selector) {
        this.selector = selector;
    }

    /**
     * Wait for the login screen to be visible
     *
     * @param {boolean} isShown
     * @return {boolean}
     */
    waitForIsShown (isShown = true) {
        return $(this.selector).waitForDisplayed(DEFAULT_TIMEOUT, !isShown);
    }
}

