import WebView from '../helpers/WebView';

const SELECTORS = {
    WEB_VIEW_SCREEN: browser.isAndroid
        ? '*//android.webkit.WebView'
        : '*//XCUIElementTypeWebView',
};

class WebViewScreen extends WebView {
    /**
     * Wait for the screen to be displayed based on Xpath
     *
     * @param {boolean} isShown
     */
    waitForWebViewIsDisplayedByXpath (isShown = true) {
        $(SELECTORS.WEB_VIEW_SCREEN).waitForDisplayed(20000, !isShown);
    }
}

export default new WebViewScreen();

export const CONTEXT_REF = {
    NATIVE: 'native',
    WEBVIEW: 'webview',
};
const DOCUMENT_READY_STATE = {
    COMPLETE: 'complete',
    INTERACTIVE: 'interactive',
    LOADING: 'loading',
};

class WebView {
    /**
     * Wait for the webview context to be loaded
     *
     * By default you have `NATIVE_APP` as the current context. If a webview is loaded it will be
     * added to the current contexts and will looks something like this
     * `["NATIVE_APP","WEBVIEW_28158.2"]`
     * The number behind `WEBVIEW` can be any string
     */
    waitForWebViewContextLoaded () {
        driver.waitUntil(
            () => {
                const currentContexts = this.getCurrentContexts();

                return currentContexts.length > 1 &&
                    currentContexts.find(context => context.toLowerCase().includes(CONTEXT_REF.WEBVIEW));
            },
            10000,
            'Webview context not loaded',
            100
        );
    }

    /**
     * Switch to native or webview context
     *
     * @param {string} context should be native of webview
     */
    switchToContext (context) {
        driver.switchContext(this.getCurrentContexts()[context === CONTEXT_REF.WEBVIEW ? 1 : 0]);
    }

    /**
     * Returns an object with the list of all available contexts
     *
     * @return {object} An object containing the list of all available contexts
     */
    getCurrentContexts () {
        return driver.getContexts();
    }

    /**
     * Wait for the document to be full loaded
     */
    waitForDocumentFullyLoaded () {
        driver.waitUntil(
            () => driver.execute(() => document.readyState) === DOCUMENT_READY_STATE.COMPLETE,
            15000,
            'Website not loaded',
            100
        );
    }

    /**
     * Wait for the website in the webview to be loaded
     */
    waitForWebsiteLoaded () {
        this.waitForWebViewContextLoaded();
        this.switchToContext(CONTEXT_REF.WEBVIEW);
        this.waitForDocumentFullyLoaded();
        this.switchToContext(CONTEXT_REF.NATIVE);
    }
}

export default WebView;

import AppScreen from './app.screen';
import Carousel from './components/carousel';

const SELECTORS = {
    SWIPE_SCREEN: '~Swipe-screen'
};

class SwipeScreen extends AppScreen {
    constructor () {
        super(SELECTORS.SWIPE_SCREEN);
    }

    get carousel () {
        return Carousel;
    }
}

export default new SwipeScreen();

import Gestures from '../../helpers/Gestures';
import { DEFAULT_TIMEOUT } from '../../constants';
import { getTextOfElement } from '../../helpers/utils';

const SELECTORS = {
    CAROUSEL: '~Carousel',
    CARD: '~card',
};

let CAROUSEL_RECTANGLES;

class Carousel extends Gestures {
    /**
     * Wait for the carousel to be (un)visible
     *
     * @param {boolean} isShown
     */
    waitForIsDisplayed (isShown = true) {
        $(SELECTORS.CAROUSEL).waitForDisplayed(DEFAULT_TIMEOUT, !isShown);
    }

    /**
     * Verify that the chosen card contains a certain text.
     * Carousel only has a max of 3 elements when 3 or more cards are provided
     * When the first or last card is active then 2 elements are present
     *
     * if first card is active
     *    the first of 2 elements is the active card
     * else if last card is active
     *    the last of 2 elements is the active card
     * else
     *    there are 3 elements and the active card is the middle one
     *
     * @param {string} nthCard Use 'first' to indicate the first card,
     *                 else use a different word to indicate the other card
     *                 like for example 'active'
     * @param {string} partialText
     */
    verifyNthCardContainsText (nthCard, partialText) {
        this.waitForIsDisplayed();

        const cards = $$(SELECTORS.CARD);
        driver.waitUntil(
            () => cards.length > 0,
            DEFAULT_TIMEOUT,
            `Expected to have more than 0 cards withing ${DEFAULT_TIMEOUT} milliseconds`,
        );

        const cardNumber = (nthCard === 'first' || cards.length === 1) ? 0 : 1;
        const cardText = getTextOfElement(cards[cardNumber]).replace(/(?:\r\n|\r|\n)/g, ' ').toLowerCase();
        const expectedText = partialText.toLowerCase();

        if (driver.isIOS) {
            return expect(cardText).toContain(expectedText);
        }

        /**
         * Needed to implement this for Android because the `flex:wrap` returns an incorrect order
         * of the text so we need to split words and verify then
         */
        return expectedText.split(' ')
            .forEach(word =>
                global.expect(cardText).toContain(word));
    }

    /**
     * Swipe the carousel to the LEFT (from right to left)
     */
    swipeLeft () {
        const carouselRectangles = this.getCarouselRectangles();
        const y = Math.round((carouselRectangles.y + carouselRectangles.height) / 2);
        Gestures.swipe(
            { x: Math.round(carouselRectangles.width - (carouselRectangles.width * 0.20)), y },
            { x: Math.round(carouselRectangles.x + (carouselRectangles.width * 0.20)), y },
        );
    }

    /**
     * Swipe the carousel to the RIGHT (from left to right)
     */
    swipeRight () {
        const carouselRectangles = this.getCarouselRectangles();
        const y = Math.round((carouselRectangles.y + carouselRectangles.height) / 2);
        Gestures.swipe(
            { x: Math.round(carouselRectangles.x + (carouselRectangles.width * 0.20)), y },
            { x: Math.round(carouselRectangles.width - (carouselRectangles.width * 0.20)), y },
        );
    }

    /**
     * Get the carousel position and size
     *
     * @return
     *  x: number,
     *  y: number,
     *  width: number,
     *  height: number,
     *
     * @example
