     *   const result = {
     *      x: 0,
     *      y: 297,
     *      width: 375,
     *      height: 395
     *    };
     * </pre>
     */
    getCarouselRectangles () {
        CAROUSEL_RECTANGLES = CAROUSEL_RECTANGLES || driver.getElementRect($(SELECTORS.CAROUSEL).elementId);
        return CAROUSEL_RECTANGLES;
    }
}

