        this.swipeOnPercentage(
            this._calculateXY(SWIPE_DIRECTION.left.start, percentage),
            this._calculateXY(SWIPE_DIRECTION.left.end, percentage),
        );
    }

    /**
     * Swipe right based on a percentage
     *
     * @param {number} percentage from 0 - 1
     */
